import React from 'react';
import styled from 'styled-components';
import { Link } from 'react-scroll';

const FooterSection = styled.footer`
  background-color: ${props => props.theme.colors.text};
  color: ${props => props.theme.colors.background};
  padding: 4rem 0 2rem;
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2rem;
`;

const FooterContent = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(250px, 1fr));
  gap: 3rem;
  margin-bottom: 3rem;
`;

const FooterColumn = styled.div``;

const ColumnTitle = styled.h3`
  font-family: ${props => props.theme.fonts.primary};
  font-size: 1.5rem;
  color: ${props => props.theme.colors.primary};
  margin-bottom: 1.5rem;
`;

const FooterLink = styled(Link)`
  display: block;
  color: ${props => props.theme.colors.background};
  text-decoration: none;
  margin-bottom: 0.8rem;
  cursor: pointer;
  transition: color 0.3s ease;

  &:hover {
    color: ${props => props.theme.colors.primary};
  }
`;

const SocialLinks = styled.div`
  display: flex;
  gap: 1rem;
  margin-top: 1rem;
`;

const SocialIcon = styled.a`
  color: ${props => props.theme.colors.background};
  font-size: 1.5rem;
  transition: color 0.3s ease;

  &:hover {
    color: ${props => props.theme.colors.primary};
  }
`;

const ContactInfo = styled.p`
  margin-bottom: 0.8rem;
  line-height: 1.6;
`;

const Divider = styled.hr`
  border: none;
  border-top: 1px solid rgba(255, 255, 255, 0.1);
  margin: 2rem 0;
`;

const BottomText = styled.p`
  text-align: center;
  font-size: 0.9rem;
  color: rgba(255, 255, 255, 0.7);
`;

const LegalLinks = styled.div`
  text-align: center;
  margin-top: 1rem;
`;

const LegalLink = styled.a`
  color: rgba(255, 255, 255, 0.7);
  text-decoration: none;
  margin: 0 1rem;
  font-size: 0.9rem;
  transition: color 0.3s ease;

  &:hover {
    color: ${props => props.theme.colors.primary};
  }
`;

const Footer = () => {
  return (
    <FooterSection>
      <Container>
        <FooterContent>
          <FooterColumn>
            <ColumnTitle>Fabulous</ColumnTitle>
            <ContactInfo>
              123 Avenue de la République<br />
              75011 Paris, France
            </ContactInfo>
            <ContactInfo>
              Tél: +33 1 23 45 67 89<br />
              Email: contact@fabulous-design.fr
            </ContactInfo>
            <SocialLinks>
              <SocialIcon href="https://instagram.com" target="_blank" aria-label="Instagram">
                <i className="fab fa-instagram"></i>
              </SocialIcon>
              <SocialIcon href="https://pinterest.com" target="_blank" aria-label="Pinterest">
                <i className="fab fa-pinterest"></i>
              </SocialIcon>
              <SocialIcon href="https://linkedin.com" target="_blank" aria-label="LinkedIn">
                <i className="fab fa-linkedin"></i>
              </SocialIcon>
            </SocialLinks>
          </FooterColumn>

          <FooterColumn>
            <ColumnTitle>Navigation</ColumnTitle>
            <FooterLink to="about" smooth={true} duration={500}>À propos</FooterLink>
            <FooterLink to="portfolio" smooth={true} duration={500}>Portfolio</FooterLink>
            <FooterLink to="services" smooth={true} duration={500}>Services</FooterLink>
            <FooterLink to="appointment" smooth={true} duration={500}>Rendez-vous</FooterLink>
            <FooterLink to="testimonials" smooth={true} duration={500}>Témoignages</FooterLink>
          </FooterColumn>

          <FooterColumn>
            <ColumnTitle>Horaires</ColumnTitle>
            <ContactInfo>
              Lundi - Vendredi: 9h - 18h<br />
              Samedi: Sur rendez-vous<br />
              Dimanche: Fermé
            </ContactInfo>
          </FooterColumn>
        </FooterContent>

        <Divider />

        <BottomText>
          © {new Date().getFullYear()} Fabulous. Tous droits réservés.
        </BottomText>

        <LegalLinks>
          <LegalLink href="/mentions-legales">Mentions légales</LegalLink>
          <LegalLink href="/politique-confidentialite">Politique de confidentialité</LegalLink>
          <LegalLink href="/cgv">CGV</LegalLink>
        </LegalLinks>
      </Container>
    </FooterSection>
  );
};

export default Footer;
